//tab functionality
$('[data-tab="dynamic"]>li>a').click(function(){
	if(!$(this).hasClass('active')){
		rel = $(this).attr('data-rel');
		$('.tabcontent').hide();
		$('[data-tab='+rel+']').fadeIn();
		$('[data-tab="dynamic"]>li>a').removeClass('active');
		$(this).addClass('active');
	}
});

